import{_ as t}from"./chunks/EditPublishedElement.DbyKNdto.js";import{_ as i,c as a,a2 as o,o as s}from"./chunks/framework.BQmytedh.js";const l="/assets/CreatePublishSelection1.Clg5fNg3.png",n="/assets/CreatePublishSetEndpoint1.B_5Dto-4.png",r="/assets/PublicationOptions1.BaDdi7Lg.png",p="/assets/PublicationOptions2.Dp_FnHGG.png",c="/assets/PublicationOptions3.DlzGXpP4.png",h="/assets/PublicationOptions4.DeHUVxK4.png",d="/assets/PublicationResume.DTgQDvWK.png",u="/assets/EditCollection.BIYmJhFd.png",m="/assets/EditCollection2.DE5tWkqF.png",b="/assets/CreatePublishHandle.CNgz4JhC.png",g="/assets/BrowsePublishedElementsDetail.tX20AYyD.png",f="/assets/BrowsePublishedElementsDetailItem.AGJsgfA0.png",C=JSON.parse('{"title":"Publish a dataset into Browse","description":"","frontmatter":{},"headers":[],"relativePath":"doc/guides/usage/publishing-calculations/publish-process.md","filePath":"doc/guides/usage/publishing-calculations/publish-process.md"}'),w={name:"doc/guides/usage/publishing-calculations/publish-process.md"};function P(k,e,v,y,_,q){return s(),a("div",null,e[0]||(e[0]=[o('<h1 id="publish-a-dataset-into-browse" tabindex="-1">Publish a dataset into Browse <a class="header-anchor" href="#publish-a-dataset-into-browse" aria-label="Permalink to &quot;Publish a dataset into Browse&quot;">​</a></h1><p>Calculations uploaded into the Create module are only accessible to registered ioChem-BD users, this will usually be comprised of a small group of individuals that conform the research group/center. Their calculations will not be accessible until they are published in the <strong>Browse module</strong>, the public module of <strong>ioChem-BD</strong>.</p><p>Before moving to the publication mechanism, it is interesting to read again the section about the organizational elements that conform each module: <a href="/doc/what-is-iochem-bd.html#modular-architecture">ioChem-BD organizative elements</a>.</p><p>So published projects become Collections and published calculations become items on the Browse module, it is a mere grammatical change to align with <a href="https://duraspace.org/dspace/" target="_blank" rel="noreferrer">DSpace software</a> naming convention.</p><p>Once published, both elements are linkable, searchable and viewable publicly.</p><h2 id="publication-requirements" tabindex="-1">Publication requirements <a class="header-anchor" href="#publication-requirements" aria-label="Permalink to &quot;Publication requirements&quot;">​</a></h2><p>To perform calculation publication, users must have defined (on Browse module) a <strong>community where to publish</strong>. The steps required to create a community and assign its administrator falls upon ioChem-BD&#39;s system administator and are described on <a href="./../../installation/publishing-endpoints-definition.html">publishing endpoints definition</a> page.</p><h2 id="publication-steps" tabindex="-1">Publication steps <a class="header-anchor" href="#publication-steps" aria-label="Permalink to &quot;Publication steps&quot;">​</a></h2><h3 id="select-the-elements-to-publish" tabindex="-1">Select the elements to publish <a class="header-anchor" href="#select-the-elements-to-publish" aria-label="Permalink to &quot;Select the elements to publish&quot;">​</a></h3><p>On Create module, navigate to the project where the desired calculations reside.</p><p>Then you must select it and right click it, then choose <em>Publish</em> from the <em>Browse module</em> section of the context menu.</p><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>Since ioChem-BD v3.0, you can only select and publish the entire project, not part of its content. You must select the project <strong>only</strong> prior publishing.  If you select other content, the publish option will not be available.</p></div><p><img src="'+l+'" alt="Project selection"></p><p>If an error message appears at this point, please read the FAQ entry about <a href="/doc/faqs/general/create-publish-error.html">no publishing community defined</a>.</p><p>A new form will be presented, showing all end points available on the Browse module.</p><p><img src="'+n+'" alt="Selected elements form"></p><p>During the publication process, the top project will become a <em>collection</em> element with all its subprojects concatenated as a Unix path.</p><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>We can change published calculation and project names by clicking the element name.</p></div><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>If a user has <a href="./../../installation/publishing-endpoints-definition.html">multiple communities</a> assigned where to to publish on, he/she can drag and drop the project to the desired community.</p></div><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>Already published elements (the ones with a green tick) cannot be moved because their path was already set on previous publications.</p></div><h3 id="publication-form-steps" tabindex="-1">Publication form steps <a class="header-anchor" href="#publication-form-steps" aria-label="Permalink to &quot;Publication form steps&quot;">​</a></h3><p>On right side of the publication form there is a group of option tabs that allow to define published element metadata and its relation to journal articles.</p><h4 id="step-1-titles-and-description" tabindex="-1">Step 1: Titles and description <a class="header-anchor" href="#step-1-titles-and-description" aria-label="Permalink to &quot;Step 1: Titles and description&quot;">​</a></h4><p>This tab allows to configure information related to published calculation:</p><blockquote><ul><li><em>Calculation naming convention</em> : We can choose to prepend full parent projects name into calculation name or set only calculation name</li><li><em>Description field</em>: If checked, calculation description field will be added as a metadata field and will be publicly accessible on Browse module.</li></ul></blockquote><p><img src="'+r+'" alt="Titles and description tab"></p><h4 id="step-2-publication-details" tabindex="-1">Step 2: Publication details <a class="header-anchor" href="#step-2-publication-details" aria-label="Permalink to &quot;Step 2: Publication details&quot;">​</a></h4><p>The next tab has two options:</p><blockquote><ul><li><em>Generate DOI for top projects</em>: will request a DOI identifier that points to the published collection.</li><li><em>Embargo published elements</em>: if marked, all published elements will be embargoed.</li></ul></blockquote><p>DOI determination can take some minutes to resolve because it requires to contact third party services (CrossRef).</p><p>Once DOI has been assigned, you will receive an email with the DOI for the published collection.</p><p>The second option will allow you to embargo (restrict) the access to your published content.</p><p><img src="'+p+'" alt="Publication details tab"></p><p>You can read more about the embargo feature on the following pages:</p><ul><li><a href="./embargo.html">Setting the embargo</a><ul><li><a href="./embargo.html#accessing-the-embargoed-elements">Accessing the embargoed elements</a></li><li><a href="./embargo.html#lifting-the-embargo">Lifting the embargo</a></li></ul></li></ul><h4 id="step-3-dataset-type" tabindex="-1">Step 3: Dataset type <a class="header-anchor" href="#step-3-dataset-type" aria-label="Permalink to &quot;Step 3: Dataset type&quot;">​</a></h4><p>This tab allows to add extra manuscript information in the case that the dataset is part of the supporting information of a paper. You can define the manuscript title, DOI and Journal.</p><p>In the situation that the paper doesn&#39;t have a valid DOI yet, you can check the checkbox <em>Not yet published, will provide it later</em>.</p><p><img src="'+c+'" alt="Manuscript information tab"></p><h4 id="step-4-additional-fields" tabindex="-1">Step 4: Additional fields <a class="header-anchor" href="#step-4-additional-fields" aria-label="Permalink to &quot;Step 4: Additional fields&quot;">​</a></h4><p>The last step is used to define other authors and institutions related to the dataset. There is also a listbox with chemical terms to enrich the published elements, such terms will be later indexed by Browse module to ease data search.</p><p>Once all the step forms have been filled, we will click the Publish button.</p><p><img src="'+h+'" alt="Additional fields tab"></p><p>After the publication process has ended, a resume window will display the link to edit published elements on Browse module and, only if you checked the embargo option, another link to review embargoed elements.</p><p><img src="'+d+'" alt="Publication resume form"></p><h3 id="published-elements-manipulation" tabindex="-1">Published elements manipulation <a class="header-anchor" href="#published-elements-manipulation" aria-label="Permalink to &quot;Published elements manipulation&quot;">​</a></h3><p>In the navigation frame, published elements will display a green tick on the right side.</p><p>Published projects and subprojects will also have an additional black tick that points to the Browse <em>Collection edit</em> page.</p><p><img src="'+t+'" alt=""></p><p>This page allows to:</p><ul><li>Change published collection name</li><li>Set related article information</li><li><a href="./embargo.html#lifting-the-embargo">Lift embargo</a></li><li>Copy reviewers link</li></ul><p>On the page that shows, the first section allows to change title, subtitle and description of the published collection:</p><p><img src="'+u+'" alt="Published collection edition form"></p><p>The next section allows set publisher metadata and embargo options:</p><p><img src="'+m+'" alt="Edit journal and embargo information section"></p><h3 id="view-published-elements-from-create" tabindex="-1">View published elements from Create <a class="header-anchor" href="#view-published-elements-from-create" aria-label="Permalink to &quot;View published elements from Create&quot;">​</a></h3><p>The projects and calculations published have a handle and a green tick on its right side.</p><p><img src="'+b+'" alt="Publication handle"></p><p>Clicking on the handle link will navigate to the published Browse content. Each collection can hold multiple Items (calculations) inside.</p><p><img src="'+g+'" alt="Published collection items"></p><p>Each published item displays the uploaded input file, an output converted CML file, additional files and its metadata.</p><p><img src="'+f+'" alt="Published item detail"></p>',62)]))}const x=i(w,[["render",P]]);export{C as __pageData,x as default};
